import * as React from "react";

interface IText {
  text: string;
}

interface IProps {}

class Exfile extends React.Component(IText, IProps) {
  ExFor = () => {};
  render() {
    return (
      <div>
        <h1>안녕</h1>
        <button onClick={this.ExFor}>시작</button>
      </div>
    );
  }
}

export default Exfile;
